INSERT INTO `adminnotification_inbox` (`notification_id`, `severity`, `date_added`, `title`, `description`, `url`, `is_read`, `is_remove`)
VALUES
	(1,4,'2016-08-10 12:27:44','Community Edition 2.0.9 Improves Performance and Product Quality ','Community Edition 2.0.9 is now available and improves storefront performance when a large number of configurable product variations are used and resolves issues with price and tax calculations, mini-cart displays and more. You can learn more in the release notes at http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.9CE.html ','http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.9CE.html',0,0),
	(2,4,'2016-08-30 06:36:54','Community Edition 2.1.1 Features Performance and Functional Improvements – 8/30/2016','Community Edition 2.1.1 improves storefront performance when using many configurable product variations and addresses upgrade and installation issues. You can learn more in the release notes at http://devdocs.magento.com/guides/v2.1/release-notes/ReleaseNotes2.1.1CE.html.','http://devdocs.magento.com/guides/v2.1/release-notes/ReleaseNotes2.1.1CE.html ',0,0),
	(3,4,'2016-09-12 12:50:17','Which Marketplaces/Social Media Platforms Matter Most? Take Our Brief Survey.','Here at Magento we are continuously looking to improve our product. \n\nWe want to know which marketplaces and social media platforms you use to advertise and sell products from your Magento store. This simple survey should take less than five minutes. Your feedback is essential and we will keep your response completely confidential.\n \nTake the survey:  https://www.research.net/r/5BZCC2Q\n','https://www.research.net/r/5BZCC2Q',0,0),
	(4,4,'2016-09-21 11:52:35','We Need Your Input! Take a Survey on CMS, Tax and Other Feature Needs','The Magento team is looking for your feedback to inform our product roadmap. We’re interested in which features you use, how we can improve built-in CMS and tax features, and what new capabilities are most important to you. Your responses will be kept confidential. Please complete the survey by September 28, 2016. Get started at https://www.research.net/r/L6TB52P\n\n','https://www.research.net/r/L6TB52P',0,0),
	(5,1,'2016-10-12 10:27:35','Community Edition 2.0.10 and 2.1.2 Resolve Critical Security Issues – 10/12/2016','Magento Community Edition 2.0.10 and 2.1.2 resolve multiple security issues, including critical vulnerabilities with certain payment methods and Zend Framework libraries. The releases also make several functional improvements and API enhancements. Learn more about the security issues in the Magento Security Center at https://magento.com/security/patches/magento-2010-and-212-security-update and functional updates at http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html.','https://magento.com/security/patches/magento-2010-and-212-security-update',0,0),
	(6,1,'2016-10-25 06:53:36','Dirty COW Linux OS Vulnerability – 10/25/2016','Dirty COW (CVE-2016-5195) is a serious vulnerability affecting most Linux Operating Systems that can be exploited to gain root access to the server. More information on how to immediately update your Linux OS is available in the Magento Security Center at https://magento.com/security/vulnerabilities/new-linux-operating-system-vulnerability. ','https://magento.com/security/vulnerabilities/new-linux-operating-system-vulnerability',0,0);
