	(281,72,0,24,'<p>Step aboard the Ocean Explorer and cruise to the wild side of Molokini! This intimate tour carries no more than 44 passengers and departs daily from Ma&rsquo;alaea Harbor. As a guest on this trip, you will spend the day exploring Maui&rsquo;s scenic coastlines, pristine reefs and abundant wildlife with Pacific Whale Foundation&rsquo;s certified marine naturalists.</p>\r\n<p>Molokini Crater is a partially submerged volcanic tuff cone in the waters between the islands of Maui and Kaho&rsquo;olawe. Utilized as fishing grounds by the native Hawaiians for centuries, it was used by the US Navy during WWII for military training exercises, and in 1977 Molokini became a Marine Life Conservation District providing protection for this incredible ecosystem.</p>\r\n<p>Ocean Explorer is our 54-foot single deck catamaran. With comfortable armchair seats arranged grandstand-style on the bow and a shaded back deck, shower, and onboard restrooms, Ocean Explorer combines comfort with the thrill of being close to the water and ocean wildlife.</p>\r\n<p>A typical day on Molokini Wildside includes breakfast on shore prior to departure and lunch (prepared onboard), 2-2.5 hours of snorkel time, and over an hour spent cruising while exploring Molokini and Maui&rsquo;s coastline.</p>\r\n<p>The itinerary changes with the weather! As a small, fast boat with a flexible itinerary, we are able to travel farther than most to make sure that our guests experience the best snorkeling that Molokini and Maui have to offer each day.</p>\r\n<p>PWF&rsquo;s expert naturalists will help you to perfect your snorkeling skills in addition to helping guests find fish and invertebrates that may be hiding in the reef.</p>\r\n<p>As an intermediate to advanced snorkel adventure, this trip is not recommended for non-swimmers, pregnant women, people with heart conditions or anyone with neck, back or knee problems.&nbsp;<strong>Children under 7 are not permitted.</strong></p>'),
	(282,82,0,24,'Molokini Wild Side Eco-Adventure'),
	(283,100,0,24,NULL),
	(284,73,0,24,'<p><span>Step aboard the Ocean Explorer and cruise to the wild side of Molokini! This intimate tour carries no more than 44 passengers and departs daily from Ma&rsquo;alaea Harbor. As a guest on this trip, you will spend the day exploring Maui&rsquo;s scenic coastlines, pristine reefs and abundant wildlife with Pacific Whale Foundation&rsquo;s certified marine naturalists.</span></p>'),
